import React, { Component } from 'react';
import * as d3 from "d3";
import {GridStructure} from './GridStructure'


export class SelectionSort extends GridStructure {
    constructor(props) {
        this.gridWidth = 30;

        this.gridHeight = 30;
        this.nRow = 10;
        this.nCol = 10;
        this.width = this.gridWidth * this.nCol;
        this.height = this.gridHeight * this.nRow;
        this.padding = 0.05;
        this.margin = {
            top: 20, bottom: 20, left: 20, right: 20
        };
        this.id = "text"
    }
}
